import { Suspense } from "react";
import App from "./App";
import React from "react";

function tt(){
   setTimeout(() => {
    return new Promise((resolve, reject) => {
        let name = "Paul"; 
        if (name === "Paul") {
          resolve("Promise resolved successfully");
        } else {
          reject(Error("Promise rejected"));
        }
      });
   }, 3000); 
}
const Test = async() => {  
    const ttk=tt();
    return <App prom={ttk}/>
};
const Major = () => {
  return (
    <Suspense fallback={<h1>Loading</h1>}>
      <Test />
    </Suspense>
  );
};

export default Major;
